import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-contact',
  templateUrl: './contact.component.html',
  styleUrls: ['./contact.component.scss']
})
export class ContactComponent implements OnInit {

  constructor() { }

  ngOnInit(): void {
  }

}
<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8">
    <title>Google Maps API Example</title>
    <style>
        #map {
            height: 400px;
        }
    </style>
    <script src="https://maps.googleapis.com/maps/api/js?key=AIzaSyDv6NZftLo91TkC4GYHFyJfGW3Y_5q_j1s"></script>
    <script>
        function initMap() {
            console.log('initMap called');

            // Create a new map object
            var map = new google.maps.Map(document.getElementById('map'), {
                center: { lat: 21.16564923510817, lng: 72.78534673554945 },
                zoom: 15
            });

            // Create a marker at the center of the map
            var marker = new google.maps.Marker({
                position: { lat: 21.16564923510817, lng: 72.78534673554945 },
                map: map,
                title: 'My Location'
            });
        }
    </script>
</head>
<body onload="initMap()">
<div id="map"></div>
</body>
</html>
